namespace DSA_C.Strings
{
    public class RepeatedStringMatchProblem
    {
        public void Start()
        {
            //string a = "";
            //string b = "";
            string a = "aaaaaaaaaaaaaaaaaaaaaab";
            string b = "ba";
            Console.WriteLine(RepeatedStringMatch(a, b));
        }

         int RepeatedStringMatch(string a, string b)  
        {
            int times = 1;            
            string tmp = a;            
            int i = times + (int)Math.Ceiling((double)b.Length/a.Length);
            while(i>=0)        
            {
                if(tmp.Contains(b))
                    return times;
                tmp+=a;
                times++;
                i--;
            }
            return -1;
        }
    }
}